import React, { useState } from "react";

const Projects = () => {
  let [number, setNumber] = useState(1);
  return (
    <div className="projects">
      <h1>Projects</h1>
      <p>{number}</p>
      <button onClick={() => setNumber(++number)}>Increase</button>
    </div>
  );
};

export default Projects;
